    false,nt"url": null,nt"notes": "Geographic Extent: North Carolina Area
    of Interest for Sandy, covering approximately 9,396 square miles. Dataset Description:
    The North Carolina - Sandy LiDAR project called for the Planning, Acquisition, processing
    and derivative products of LIDAR data to be collected at a nominal pulse spacing
    (NPS) of 0.7 meter. Project specifications are based on the U.S. Geological Survey
    National Geospatial Program Base LIDAR Specification, Version 1. The data was developed
    based on a horizontal projection/datum of North Carolina State Plane Coordinate
    System, NAD83, survey feet and vertical datum of NAVD1988 (GEOID12A), survey feet.
    LiDAR data was delivered in RAW flight line swath format, processed to create Classified
    LAS 1.3 Files formatted to 12138 individual 5000ft x 5000ft tiles, and corresponding
    Intensity Images and Bare Earth DEMs tiled to the same 5000ft x 5000ft schema, and
    Breaklines in ESRI File-Geodatabase format. Ground Conditions: LiDAR was collected
    in Spring 2014, while no snow was on the ground and rivers were at or below normal
    levels. In order to post process the LiDAR data to meet task order specifications,
    Photo Science established a total of 282 QA control points and 161 Land Cover control
    points that were used to calibrate the LIDAR to known ground locations established
    throughout the North Carolina - Sandy project area.",nt"license_title": null,nt"extras":
